import React, { Component } from "react";
class InputCurrency extends Component {
  state = {
    id: "USD",
    text: "United States Dollars"
  };

  render() {
    return (
      <React.Fragment>
        <div>
          {this.state.id} - {this.state.text}
        </div>
        {this.state.id}
        <input type="text" />
      </React.Fragment>
    );
  }
}

export default InputCurrency;
